// src/AdminDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import './style.css'; // Make sure this file exists and is properly linked

const AdminDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">Admin Dashboard</h1>
      <p className="dashboard-welcome">Welcome, Admin!</p>
      <ul className="dashboard-links">
        <li>
          <Link to="/admin/review" className="dashboard-link">Review and approve car submissions</Link>
        </li>
        <li>
          <Link to="/admin/users" className="dashboard-link">Manage users</Link>
        </li>
        <li>
          <Link to="/admin/stats" className="dashboard-link">View system statistics</Link>
        </li>
      </ul>
    </div>
  );
};

export default AdminDashboard;
